import React, { useState } from 'react';
import "./Page.css";

function Page({ id, img, about1, about2, section, info, logo }) {

    const [popupID, setPopUpId] = useState(null);
    const [isVisible, setIsVisible] = useState(false);

    const toggleVisibility = () => {
        setIsVisible(!isVisible);
    }

    const frontpic = (item) => {
        return item.pictures[0];
    };

    const handlePopUp = (itemId) => {
        setPopUpId(itemId);
    }

    const handlePopUpClose = () => {
        setPopUpId(null);
    };

  return (
    <div className="Page" id = {id}>

        {about1 ? (
        <div className = "mainpage">
            <div className = "img-container">
                <img src = {img} alt ="" className = "pic"/>
            </div>
            <div id = "mainintro">
                <h2 id = "main"> hello! I'm Krystal Pothilat</h2>
                <ul className = "text" id = "cookiepoints">
                    <li> San Diego, CA</li>
                    <li> B.S. in Computer Science at UC Riverside</li>
                </ul>
            </div>
        </div>  
        ) : about2 ? (
            <div className = "aboutpage"> 
                <div className = "header-container">
                    <img src = {img} alt = "" className = "header-banner"/>
                    <p className = "header"> {section} </p>
                </div>
                <div className = "about">
                    {Array.isArray(info) && info.map((item) => (

                        <div className = "about-container" key = {item.id} onClick={() => {handlePopUp(item.id); toggleVisibility() }}>
                            <img src = {frontpic} alt = "" className = "pic"/>
                            <h2 className = "label">{item.title}</h2>
                            {popupID === item.id && isVisible && (
                                <div className = "about-pop-up" id = {item.id}>
                                <h2>{item.title} </h2>
                                <p>{item.description}</p>
                                {Array.isArray(item.pictures) && item.pictures.map((pic) => (
                                    <div className = "pic" id = "about-sec-pic">

                                    </div>
                                ))}
                                <button onClick ={() => handlePopUpClose()}>Close</button>
                                </div>

                            )} 
                        </div>
                    ))}
                </div>

            </div>

        ) : (
            <div className = "infopage">
                <div className = "header-container">
                    <img src = {img} alt = "" className = "header-banner"/>
                    <p className = "header"> {section} </p>
                </div>

                {logo && <img src={logo} alt="Logo" className="logo" />}
                <div className = "info">
                    {Array.isArray(info) && info.map((item) => (
                        <div className = "info-container">
                            <h2 id = "title"> {item.title}</h2>
                            <p className = "text"> {item.description} </p>
                            {item.bulletpoints && (
                            <ul className = "text">
                                {item.bulletpoints.map((bulletpoints, index) => (
                                    <li key={index}>{bulletpoints}</li>
                                ))}
                            </ul>
                            )}
                        </div>
                    ))}
                </div>
            </div>
        )}


    </div>
  );
}

export default Page;
